import React from 'react';

const SaveWall = ({ onSave, onDelete }) => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', gap: '10px', marginTop: '10px' }}>
      <button
        style={{
          backgroundColor: '#4CAF50',
          color: 'white',
          padding: '10px 20px',
          border: 'none',
          borderRadius: '5px',
          fontSize: '16px',
          cursor: 'pointer',
          fontWeight: 'bold',
        }}
        onClick={onSave}
      >
        Save Wall
      </button>
      <button
        style={{
          backgroundColor: '#f44336',
          color: 'white',
          padding: '10px 20px',
          border: 'none',
          borderRadius: '5px',
          fontSize: '16px',
          cursor: 'pointer',
          fontWeight: 'bold',
        }}
        onClick={onDelete}
      >
        Delete Selected Image
      </button>
    </div>
  );
};

export default SaveWall;
